    true,nt"url": null,nt"notes": "Dual Enrollment Programs and Courses for
    High School Students, 2002-03 (PEQIS 14), is a study that is part of the Postsecondary
    Education Quick Information System (PEQIS) program; program data is available since
    1997 at <http://nces.ed.gov/surveys/peqis/>. PEQIS 14 (http://nces.ed.gov/pubsearch/pubsinfo.asp?pubid=2009045)
    is a cross-sectional survey that collected information on the topic of dual enrollment
    of high school students at postsecondary institutions. 1,600 Title IV degree-granting
    postsecondary institutions in the 50 United States and the District of Columbia
    were sampled. The study was conducted using online or paper surveys. The overall
    response rates were 92 percent weighted and 91 percent unweighted. Key statistics
    produced from PEQIS 14 were information on the prevalence of college course-taking
    by high school students at their institutions during the 2002-03 12-month academic
    year, both within and outside of dual enrollment programs. Among institutions with
    dual enrollment programs, additional information was obtained on the characteristics
    of programs, including course location and type of instructors, program and course
    curriculum, academic eligibility requirements, and funding.",nt"license_title":
